local_offer.description:
Teachers respond to children’s needs by:
• providing support for children who need help with communication, 
language and literacy and numeracy;
• planning to develop children’s understanding through the use of all 
available senses and experiences;
• planning for children’s full participation in learning, and in physical and 
practical activities;
• helping children to manage their behaviour and to take part in 
learning effectively and safely;
• helping individuals to manage their emotions, particularly trauma or 
stress, and to take part in learning.
